import React from "react";
import '../Assets/Styles/ServicesComponentSyles.css'
function ServicesComponent(props){
    return(
        <div className="service-card">
             <h1>{props.title}</h1>
             <p>{props.description}</p>
        </div>
    );
}

export default ServicesComponent;
